def kmer(text,i,k):
  return (text[i:i+k])

def Skew(genome):
  skews=[0]*(len(genome)+1)
  for i in range (1,len(genome)+1):
    if kmer(genome,0,i)[-1]=="G":
      skews[i]=skews[i-1] + 1
    else:
      if kmer(genome,0,i)[-1]=="C":
        skews[i]=skews[i-1] - 1
      else:
        skews[i]=skews[i-1]
  return skews

def MinimumSkew(genome):
  skews=Skew(genome)
  minimum=min(skews)
  indexi=[]
  for i in range(0,len(skews)):
    if (skews[i]==minimum):
      indexi.append(i)
      print(i,end=" ")

